import axios from "axios";

const initialState = {
  signupInfo: null,
  isLoggedIn: false,
  myInfo: null,
};

const SIGNUP_REQUEST = "SIGNUP_REQUEST";
const SIGNUP_SUCCESS = "SIGNUP_SUCCESS";
const SINGUP_FAILURE = "SIGNUP_FAILURE";

const signupAPI = (formData) => {
  return axios.post("http://localhost:3065/user/signup", formData);
};

export const signupReq = (formData) => async (dispatch) => {
  try {
    dispatch({ type: SIGNUP_REQUEST });
    const res = await signupAPI(formData);
    console.log(res);
  } catch (err) {}
};

export default function reducer(state = initialState, action) {
  switch (action.type) {
    case SIGNUP_REQUEST:
      return {
        ...state,
      };
    case SIGNUP_SUCCESS:
      return {};
    case SINGUP_FAILURE:
      return {};
    default:
      return state;
  }
}
